@Ocean Core Dev @Ocean Managers @Community Manager @LRT Should we share these Github issue threads in a more public channel & encourage people to contribute? Perhaps even an announcement

> Hi Sarah, your initiative makes a lot of sense. Now, would it be possible to do this activity for free? For example in Geneva i was able to organize something sponsored by a blockchain interest group who offered the room, and I actually paid for the meetup group myself. I think meetup.com has gotten more expensive, since then 😅  but at the same time nothing prevents you from using the official Ocean Protocol to setup the meetup in Melbourne. Then it's a question of promoting it locally. Food is optional IMO. Also in these uncertain times, wouldn't it make sense to have a virtual meetup anyways?
@LRT  I will see if there’s (free) platforms unlike Meetup.com where I can get people together. Meetup is my go-to for all networking but there’s probably free sites. Most meetings are virtual anyway. 

If I make a group and it gets big, maybe then it would make sense to invest in meetup to reach out even further, but you’re right that it’s best to start small before doing the monthly payment. Thanks for the advice 🙂

